import Task from "./Task"

const Tasks = ({tasks, onDelete, onToggle}) => {
    
    return (
        <div className="container">
            {tasks.map((task) => (
                <Task key={key} task={task} onDelete={onDelete} onToggle={onToggle}/>
            ))} 
        </div>
    )
}

export default Tasks
